static void
nettrace_bpf__destroy(struct nettrace_bpf *obj)
{
	if (!obj)
		return;
	if (obj->skeleton)
		bpf_object__destroy_skeleton(obj->skeleton);
	free(obj);
}

static inline int
nettrace_bpf__create_skeleton(struct nettrace_bpf *obj);

static inline struct nettrace_bpf *
nettrace_bpf__open_opts(const struct bpf_object_open_opts *opts)
{
	struct nettrace_bpf *obj;
	int err;

	obj = (struct nettrace_bpf *)calloc(1, sizeof(*obj));
	if (!obj) {
		errno = ENOMEM;
		return NULL;
	}

	err = nettrace_bpf__create_skeleton(obj);
	if (err)
		goto err_out;

	err = bpf_object__open_skeleton(obj->skeleton, opts);
	if (err)
		goto err_out;

	return obj;
err_out:
	nettrace_bpf__destroy(obj);
	errno = -err;
	return NULL;
}

static inline struct nettrace_bpf *
nettrace_bpf__open(void)
{
	return nettrace_bpf__open_opts(NULL);
}

static inline int
nettrace_bpf__load(struct nettrace_bpf *obj)
{
	return bpf_object__load_skeleton(obj->skeleton);
}

static inline struct nettrace_bpf *
nettrace_bpf__open_and_load(void)
{
	struct nettrace_bpf *obj;
	int err;

	obj = nettrace_bpf__open();
	if (!obj)
		return NULL;
	err = nettrace_bpf__load(obj);
	if (err) {
		nettrace_bpf__destroy(obj);
		errno = -err;
		return NULL;
	}
	return obj;
}

